import React from 'react'
import PaymentForm from './PaymentForm';
import SellingView from './SellingView'
import PaymentList from './PaymentList';

const Home = () => {
  return (
    <div>
        <SellingView />
        <PaymentForm />
        <PaymentList />
    </div>
  )
}

export default Home;
